### IMVNotGetDie (IMVNotGetDie1 & IMVNotGetDie2): Do no get mechanical ventilation, go on to die ########
dim(IMVNotGetDie1) <- c(17, 8)
dim(IMVNotGetDie2) <- c(17, 8)

IMVNotGetDie1_0[, ] <- user()
