  sum(IOxGetLive1[i, j:8]) + sum(IOxGetLive2[i, j:8]) + sum(IOxGetDie1[i, j:8]) + sum(IOxGetDie2[i, j:8]) + sum(IOxNotGetLive1[i, j:8]) + sum(IOxNotGetLive2[i, j:8]) +
